# Import the trainer class that contains compute_loss
from open_r1.trainer.grpo_trainer import VLMGRPOTrainer


class MockModel(torch.nn.Module):
    """Mock model that returns predefined logits"""
    def __init__(self, logits):
        super().__init__()
        self.logits = logits
        self.warnings_issued = {}
        
    def forward(self, input_ids, attention_mask, **kwargs):
        result = Mock()
        result.logits = self.logits
        return result


class TestComputeLoss(unittest.TestCase):
    """Test VLMGRPOTrainer.compute_loss function - compute loss function for GRPO training"""
    
    def setUp(self):
        torch.manual_seed(42)
        self.device = torch.device('cpu')
        
    def _create_mock_trainer(self, epsilon_low=0.1, epsilon_high=0.2, beta=0.01, num_iterations=1):
        """Create a minimal mock trainer with attributes required by compute_loss"""
        trainer = Mock(spec=VLMGRPOTrainer)
        
        # Set necessary attributes
        trainer.epsilon_low = epsilon_low
        trainer.epsilon_high = epsilon_high
        trainer.beta = beta
        trainer.num_iterations = num_iterations
        trainer._step = 0
        trainer._buffered_inputs = [None] * 4
        trainer._metrics = defaultdict(list)
        
        # Create mock state
        trainer.state = Mock()
        trainer.state.global_step = 0
        
        # Create mock args
        trainer.args = Mock()
        trainer.args.gradient_accumulation_steps = 4
        
        # Create mock accelerator
        trainer.accelerator = Mock()
        trainer.accelerator.gather_for_metrics = lambda x: x
        
        # Use real compute_loss method
        trainer.compute_loss = lambda model, inputs, return_outputs=False, num_items_in_batch=None: \
            VLMGRPOTrainer.compute_loss(trainer, model, inputs, return_outputs, num_items_in_batch)
        
        # Use real _get_per_token_logps method
        trainer._get_per_token_logps = lambda model, input_ids, attention_mask, **kwargs: \
            VLMGRPOTrainer._get_per_token_logps(trainer, model, input_ids, attention_mask, **kwargs)
        
        # Mock _generate_and_score_completions to return inputs
        trainer._generate_and_score_completions = lambda inputs, model: inputs
        
        return trainer
    
